Photo by @amivitale | Hindou Oumarou Ibrahim collects water with the women of the village of Gouwa, Chad. Hindou, a member of the Mbororo pastoralist community, is joining in on a task that women and girls collectively spend 200 million hours on daily—a task that is becoming increasingly difficult as climate change makes water resources more scarce. Hindou, however, has spent her life trying to help. At the age of 15, she founded the Association of Indigenous Peul Women and Peoples of Chad, an organization focused on rights and environmental protection. Since then, she has taken her work on behalf of indigenous peoples, women, and the environment to the highest levels. Most recently she addressed the delegates at #COP25 urging action. Hindou recently received the 2019 Pritzker Environmental Genius Award by UCLA's Environmental Institute, a prize I'm proud to have nominated her for. I was in Chad with @rippleeffectimages to document Hindou's work.
Follow @amivitale and @rippleeffectimages for more stories of women empowering women. 
